export default function LandingImage({ className }) {
	return (
		<svg
			width="143"
			className={className}
			height="143"
			viewBox="0 0 143 143"
			fill="none"
			xmlns="http://www.w3.org/2000/svg"
			xmlnsXlink="http://www.w3.org/1999/xlink"
		>
			<rect width="143" height="143" fill="url(#pattern0)" />
			<defs>
				<pattern id="pattern0" patternContentUnits="objectBoundingBox" width="1" height="1">
					<use xlinkHref="#image0" transform="scale(0.00179211)" />
				</pattern>
				<image
					id="image0"
					width="558"
					height="558"
					xlinkHref="data:image/png;base64,"
				/>
			</defs>
		</svg>
	);
}
